  "Link to description": "\uBE60\uB978 \uB370\uC774\uD130 \uD14C\uC774\uBE14 \uAD00\uACC4 \uC0DD\uC131\uC5D0 \uC0AC\uC6A9\uB418\uBA70 \uB300\uBD80\uBD84\uC758 \uD45C\uC900 \uC2DC\uB098\uB9AC\uC624\uC640 \uD638\uD658\uB429\uB2C8\uB2E4. \uBE44\uAC1C\uBC1C\uC790\uC5D0\uAC8C \uC801\uD569\uD569\uB2C8\uB2E4. \uD544\uB4DC\uB85C \uC874\uC7AC\uD560 \uB54C, \uBAA9\uC801 \uB370\uC774\uD130 \uD14C\uC774\uBE14\uC758 \uB370\uC774\uD130\uB97C \uC120\uD0DD\uD560 \uC218 \uC788\uB294 \uB4DC\uB86D\uB2E4\uC6B4\uC774 \uB429\uB2C8\uB2E4. \uC0DD\uC131 \uD6C4, \uD604\uC7AC \uB370\uC774\uD130 \uD14C\uC774\uBE14\uC758 \uAD00\uB828 \uD544\uB4DC\uAC00 \uBAA9\uC801 \uB370\uC774\uD130 \uD14C\uC774\uBE14\uC5D0 \uB3D9\uC2DC\uC5D0 \uC0DD\uC131\uB429\uB2C8\uB2E4.",
